/*import "./Eliminar.css";*/

const UserProfile = ({isOpenU, closeU}) =>{

    return(
    <div className={`UserContainer ${isOpenU && 'UserContainer-Open'}`}>
        <div className="User-Dialog">
            <div className="ButtonsUs">
                <a className="BtnNoti" href="">Notificaciones</a>
            </div>
            <div className="ButtonsUs">
                    <a className="BtnMres" href="">Mis reservas</a>
            </div>
            <div className="ButtonsUs">
                    <a className="BtnSalir" href="">Salir</a>
            </div>
        </div>
    </div>
    );
}

export default UserProfile;
